/* Private function prototypes -----------------------------------------------*/
static void BackGroundCallback(WM_MESSAGE * pMsg);
/* Private functions ---------------------------------------------------------*/

/**
  * @brief  Backbground callback
  * @param  pMsg: pointer to data structure of type WM_MESSAGE
  * @retval None
  */

static void BackGroundCallback(WM_MESSAGE * pMsg) 
{
  uint16_t   xPos, Step = 20, i;
  const GUI_BITMAP * pBm;
  
  switch (pMsg->MsgId) 
  {
  case WM_PAINT:    
    GUI_SetBkColor(GUI_LIGHTBLUE);
    GUI_Clear();
    
    GUI_DrawBitmap(&bmSTLogo, (LCD_GetXSize() - bmSTLogo.XSize)/2 , (LCD_GetYSize() - bmSTLogo.YSize)/2); 
    
    for (i = 0, xPos = LCD_GetXSize() / 2 - 2 * Step; i < 5; i++, xPos += Step) 
    {
      pBm = (idx == i) ? &_bmWhiteCircle_10x10 : &_bmWhiteCircle_6x6;
      GUI_DrawBitmap(pBm, xPos - pBm->XSize / 2, 250 - pBm->YSize / 2);
    }
    break;
    
  default:
    WM_DefaultProc(pMsg); 
  } 
}

/**
  * @brief  Startup
  * @param  None
  * @retval None
  */
void k_StartUp(void)
{
  uint8_t loop;
  GUI_RECT Rect = {45, 230, 195, 280}; 

  WM_SetCallback(WM_HBKWIN, BackGroundCallback);

  loop = 16;
  while (loop--)
  {
    idx = (16- loop) % 5;

    WM_InvalidateArea(&Rect);
    
    GUI_Delay(200);
  }
}

